goog.require("axs.AuditRules");goog.require("axs.browserUtils");goog.require("axs.constants.Severity");goog.require("axs.dom");goog.require("axs.utils");axs.AuditRules.addRule({name:"focusableElementNotVisibleAndNotAriaHidden",heading:"These elements are focusable but either invisible or obscured by another element",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_focus_01",severity:axs.constants.Severity.WARNING,relevantElementMatcher:function(element){var isFocusable=axs.browserUtils.matchSelector(element,axs.utils.FOCUSABLE_ELEMENTS_SELECTOR);if(!isFocusable)return!1;if(0<=element.tabIndex)return!0;for(var parent=axs.dom.parentElement(element);null!=parent;parent=axs.dom.parentElement(parent)){if(axs.utils.elementIsAriaWidget(parent))return!1}var textAlternatives=axs.properties.findTextAlternatives(element,{});if(null===textAlternatives||""===textAlternatives.trim())return!1;return!0},test:function(element,flags){if(flags.hidden)return!1;element.focus();return!axs.utils.elementIsVisible(element)},code:"AX_FOCUS_01"});